var images = ["https://metrolina.org/wp-content/uploads/2010/08/familypic.jpg",
"data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSQMsXiaxrVd2uSmugRmopBr2D6CbALafT4xQ&usqp=CAU", 
  "data:image/jpeg;base64,",
   "data:image/jpeg;base64,"];
var names = ["Family","Dad", "Brother", "Sister", "Mom",];
var i = 0;
function update()
{
    i++;
    var numbers_of_family_member_in_array = 4
    if(i > numbers_of_family_member_in_array )
    {
        i = 0;
    }
    var updatedImage = images[i];
    var updatedName  = names[i];
    document.getElementById("family_member_image").src = updatedImage;
    document.getElementById("family_member_name").innerHTML = updatedName;
}
